import React, {Fragment} from "react";
import { Col, Form, Row } from "react-bootstrap";

const Login = () => {
  return <Fragment>
      <div className="conatiner">
          <Row>
              <Col>
                  <Form>
                      <Form.Group>
                          <Form.cont></Form.cont>
                      </Form.Group>
                  </Form>
              </Col>
          </Row>
      </div>
  </Fragment>;
};

export default Login;
